import React, { useEffect, useDebugValue, useState } from 'react';
import './apple.json';

function Main(){

    const [data, setData] = useState([]);
    useEffect(() =>{
        fetch("./apple.json")
        .then(data => data.json())
        .then(res => setData(res))
    }, []);

    console.log(data);
    return(
        <div className="Main">
            <div className="container">

            </div>
        </div>
    )
};

export default Main;
